import { useState } from "react";
import { useEffect } from "react";
import GetUsersItem from "./components/GetUsersItem";
import { TEST_URL } from './MAIN.js';

function Test() {
    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [GettedUsers, setGettedUsers] = useState([]);

    const [userItems, setUserItems] = useState(GettedUsers)
    
    function GetUsers() {

        useEffect(() => {
            fetch(TEST_URL)
                .then(response => response.json())
                .then(
                    (result) => {
                        setIsLoaded(true);
                        setUserItems(result);
                    },
                    // Примечание: важно обрабатывать ошибки именно здесь, а не в блоке catch(),
                    // чтобы не перехватывать исключения из ошибок в самих компонентах.
                    (error) => {
                        setIsLoaded(true);
                        setError(error);
                    }
                )
        }, [])
        return GettedUsers;
    }
    GetUsers();

    return (
        <div className="App">
            {userItems.map(item =>
                <GetUsersItem item={item} key={item.id} />
            )}

        </div>
    )
}

export default Test
